0\u0435\u0431\u0440\u043e\u0432, \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0430\u043d\u0434\u0440 \u0421\u0435\u0440\u0435\u0431\u0440\u043e\u0432<\/a> \u0443\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b \u0440\u0435\u043a\u043e\u0440\u0434, \u0432 \u0434\u0435\u0432\u044f\u0442\u044b\u0439 \u0440\u0430\u0437 \u0432\u044b\u0439\u0434\u044f \u0432 \u043e\u0442\u043a\u0440\u044b\u0442\u044b\u0439 \u043a\u043e\u0441\u043c\u043e\u0441.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2000\" class=\"mw-redirect\" title=\"2000\">2000<\/a>&#160;\u2014 \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%B0%D0%BB%D0%B8%D0%B1%D1%8B\" class=\"mw-redirect\" title=\"\u0422\u0430\u043b\u0438\u0431\u044b\">\u0422\u0430\u043b\u0438\u0431\u0430\u043d<\/a> \u0437\u0430\u043f\u0440\u0435\u0442\u0438\u043b\u043e \u043d\u0430\u0441\u0435\u043b\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D0%B3%D0%B0%D0%BD%D0%B8%D1%81%D1%82%D0%B0%D0%BD\" title=\"\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\">\u0410\u0444\u0433\u0430\u043d\u0438\u0441\u0442\u0430\u043d\u0430<\/a> \u0437\u0430\u043d\u0438\u043c\u0430\u0442\u044c\u0441\u044f \u0441\u043f\u043e\u0440\u0442\u043e\u043c \u043f\u043e \u0432\u0435\u0447\u0435\u0440\u0430\u043c.<\/li><\/ul><h3>XXI \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002\" class=\"mw-redirect\" title=\"2002\">2002<\/a><ul><li>\u0418\u0441\u043f\u0430\u043d\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0440\u0435\u0448\u0438\u043b\u043e \u0432\u043e \u0432\u0440\u0435\u043c\u044f \u043f\u0440\u0435\u0434\u0441\u0442\u043e\u044f\u0449\u0435\u0433\u043e \u0432\u0438\u0437\u0438\u0442\u0430 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B4%D1%80%D0%B8%D0%B4\" title=\"\u041c\u0430\u0434\u0440\u0438\u0434\">\u041c\u0430\u0434\u0440\u0438\u0434<\/a> \u043f\u0440\u0435\u0437\u0438\u0434\u0435\u043d\u0442\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%80%D0%B0%D0%BD\" title=\"\u0418\u0440\u0430\u043d\">\u0418\u0440\u0430\u043d\u0430<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A5%D0%B0%D1%82%D0%B0%D0%BC%D0%B8,_%D0%9C%D0%BE%D1%85%D0%B0%D0%BC%D0%BC%D0%B0%D0%B4\" title=\"\u0425\u0430\u0442\u0430\u043c\u0438, \u041c\u043e\u0445\u0430\u043c\u043c\u0430\u0434\">\u041c\u043e\u0445\u0430\u043c\u043c\u0435\u0434\u0430 \u0425\u0430\u0442\u0430\u043c\u0438<\/a> \u0438\u0441\u043a\u043b\u044e\u0447\u0438\u0442\u044c \u0438\u0437 \u043f\u0440\u043e\u0433\u0440\u0430\u043c\u043c\u044b \u0435\u0433\u043e \u043f\u0440\u0435\u0431\u044b\u0432\u0430\u043d\u0438\u044f \u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0439 \u043f\u043e \u043f\u0440\u043e\u0442\u043e\u043a\u043e\u043b\u0443 \u043f\u0430\u0440\u0430\u0434\u043d\u044b\u0439 \u0443\u0436\u0438\u043d, \u043f\u043e\u0442\u043e\u043c\u0443 \u043a\u0430\u043a \u0438\u0440\u0430\u043d\u0446\u044b \u043e\u0442\u043a\u0430\u0437\u044b\u0432\u0430\u044e\u0442\u0441\u044f \u0441\u0435\u0441\u0442\u044c \u0437\u0430 \u0441\u0442\u043e\u043b, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u043e\u0434\u0430\u044e\u0442 \u0432\u0438\u043d\u043e.<\/li><li>\u0413\u043b\u0430\u0432\u043d\u044b\u0439 \u0440\u0435\u0434\u0430\u043a\u0442\u043e\u0440 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D0%92%D0%A1_(%D1%82%D0%B5%D0%BB%D0%B5%D0%BA%D0%B0%D0%BD%D0%B0%D0%BB)\" class=\"mw-redirect\" title=\"\u0422\u0412\u0421 (\u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b)\">\u0422\u0412\u0421<\/a>\u00bb \u0438 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440 \u043a\u043e\u043c\u043f\u0430\u043d\u0438\u0438 \u00ab\u0428\u0435\u0441\u0442\u043e\u0439 \u0442\u0435\u043b\u0435\u043a\u0430\u043d\u0430\u043b\u00bb <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%81%D0%B5%D0%BB%D1%91%D0%B2,_%D0%95%D0%B2%D0%B3%D0%B5%D0%BD%D0%B8%D0%B9_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B5%D0%B2%D0%B8%D1%87\" title=\"\u041a\u0438\u0441\u0435\u043b\u0451\u0432, \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u0410\u043b\u0435\u043a\u0441\u0435\u0435\u0432\u0438\u0447\">\u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u041a\u0438\u0441\u0435\u043b\u0451\u0432<\/a> \u043f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u043b \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044e \u043e \u0442\u043e\u043c, \u0447\u0442\u043e \u043a\u0430\u043d\u0434\u0438\u0434\u0430\u0442\u0443\u0440\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D1%85,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4_%D0%A0%D0%B5%D0%B9%D0%BD%D0%B3%D0%BE%D0%BB%D1%8C%D0%B4%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u041a\u043e\u0445, \u0410\u043b\u044c\u0444\u0440\u0435\u0434 \u0420\u0435\u0439\u043d\u0433\u043e\u043b\u044c\u0434\u043e\u0432\u0438\u0447\">\u0410\u043b\u044c\u0444\u0440\u0435\u0434\u0430 \u041a\u043e\u0445\u0430<\/a> \u0431\u044b\u043b\u0430 \u043f\u0440\u0435\u0434\u043b\u043e\u0436\u0435\u043d\u0430 \u0432 \u043a\u0430\u0447\u0435\u0441\u0442\u0432\u0435 \u043d\u043e\u0432\u043e\u0433\u043e \u0433\u0435\u043d\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u0430 \u0422\u0412\u0421. \u00ab\u0412 \u0441\u043b\u0443\u0447\u0430\u0435, \u0435\u0441\u043b\u0438 \u0433\u0435\u043d\u0434\u0438\u0440\u0435\u043a\u0442\u043e\u0440\u043e\u043c \u0422\u0412\u0421 \u0441\u0442\u0430\u043d\u0435\u0442 \u0432\u0441\u0451-\u0442\u0430\u043a\u0438 \u041a\u043e\u0445, \u043c\u044b \u0441\u043e\u0431\u0438\u0440\u0430\u0435\u043c \u0432\u0435\u0449\u0438 \u0438 \u0443\u0445\u043e\u0434\u0438\u043c. \u0415\u0441\u043b\u0438 \u0443 \u0430\u043a\u0446\u0438\u043e\u043d\u0435\u0440\u043e\u0432 \u043d\u0435\u0442 \u043f\u043e\u043d\u044f\u0442\u0438\u0439 \u043e \u0447\u0435\u0441\u0442\u0438 \u0438 \u0434\u043e\u0441\u0442\u043e\u0438\u043d\u0441\u0442\u0432\u0435, \u044d\u0442\u043e \u043d\u0435 \u043d\u0430\u0448\u0430 \u043f\u0440\u043e\u0431\u043b\u0435\u043c\u0430\u00bb,&#160;\u2014 \u0441\u043a\u0430\u0437\u0430\u043b \u0415\u0432\u0433\u0435\u043d\u0438\u0439 \u041a\u0438\u0441\u0435\u043b\u0451\u0432 \u0432 \u0438\u043d\u0442\u0435\u0440\u0432\u044c\u044e \u0433\u0430\u0437\u0435\u0442\u0435 \u0418\u0437\u0432\u0435\u0441\u0442\u0438\u044f.<\/li><li>\u041d\u0430 \u0437\u0430\u0441\u0435\u0434\u0430\u043d\u0438\u0438 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c\">\u041c\u043e\u0441\u043e\u0431\u043b\u0430\u0441\u0442\u0438<\/a> \u0431\u044b\u043b\u043e \u043f\u0440\u0438\u043d\u044f\u0442\u043e \u0435\u0434\u0438\u043d\u043e\u0433\u043b\u0430\u0441\u043d\u043e\u0435 \u0440\u0435\u0448\u0435\u043d\u0438\u0435 \u0441\u043d\u0438\u0437\u0438\u0442\u044c \u0442\u0430\u0440\u0438\u0444\u044b \u043d\u0430 \u0433\u0430\u0437 \u0434\u043b\u044f \u043f\u0440\u0430\u0432\u043e\u0441\u043b\u0430\u0432\u043d\u044b\u0445 \u0445\u0440\u0430\u043c\u043e\u0432, \u0446\u0435\u0440\u043a\u0432\u0435\u0439 \u0438 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u0435\u0439, \u0440\u0430\u0441\u043f\u043e\u043b\u043e\u0436\u0435\u043d\u043d\u044b\u0445 \u043d\u0430 \u0442\u0435\u0440\u0440\u0438\u0442\u043e\u0440\u0438\u0438 \u0440\u0435\u0433\u0438\u043e\u043d\u0430.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2003\" class=\"mw-redirect\" title=\"2003\">2003<\/a>&#160;\u2014 \u0433\u0438\u0442\u0430\u0440\u0438\u0441\u0442 \u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u0442\u0435\u043b\u044c \u0433\u0440\u0443\u043f\u043f\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Evanescence\" title=\"Evanescence\">Evanescence<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D1%83%D0%B4%D0%B8,_%D0%91%D0%B5%D0%BD\" title=\"\u041c\u0443\u0434\u0438, \u0411\u0435\u043d\">Ben Moody<\/a> \u043f\u043e\u043a\u0438\u043d\u0443\u043b \u0441\u043e\u0441\u0442\u0430\u0432 \u0433\u0440\u0443\u043f\u043f\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005\" class=\"mw-redirect\" title=\"2005\">2005<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Boeing_737_%D0%B2_%D0%9B%D0%B0%D0%B3%D0%BE%D1%81%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Boeing 737 \u0432 \u041b\u0430\u0433\u043e\u0441\u0435\">\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Boeing 737 \u0432 \u041b\u0430\u0433\u043e\u0441\u0435<\/a>.<ul><li>\u041d\u0430\u0434 \u043f\u043e\u0431\u0435\u0440\u0435\u0436\u044c\u0435\u043c \u0410\u0442\u043b\u0430\u043d\u0442\u0438\u0447\u0435\u0441\u043a\u043e\u0433\u043e \u041e\u043a\u0435\u0430\u043d\u0430 \u0441\u0444\u043e\u0440\u043c\u0438\u0440\u043e\u0432\u0430\u043b\u0441\u044f \u0443\u0440\u0430\u0433\u0430\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%8D%D0%BD%D0%B4%D0%B8_(%D1%83%D1%80%D0%B0%D0%B3%D0%B0%D0%BD)\" title=\"\u0421\u044d\u043d\u0434\u0438 (\u0443\u0440\u0430\u0433\u0430\u043d)\">\u0421\u044d\u043d\u0434\u0438<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009\" class=\"mw-redirect\" title=\"2009\">2009<\/a><ul><li>\u041e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u0439 \u0432\u044b\u0445\u043e\u0434 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Windows_7\" title=\"Windows 7\">Windows 7<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%82\" class=\"mw-redirect\" title=\"\u0415\u0432\u0440\u043e\u043f\u0430\u0440\u043b\u0430\u043c\u0435\u043d\u0442\">\u0415\u0432\u0440\u043e\u043f\u0430\u04