ia.org\/wiki\/%D0%9F%D1%80%D0%B5%D0%BC%D0%B8%D1%8F_%D0%B8%D0%BC%D0%B5%D0%BD%D0%B8_%D0%A1%D0%B0%D1%85%D0%B0%D1%80%D0%BE%D0%B2%D0%B0\" title=\"\u041f\u0440\u0435\u043c\u0438\u044f \u0438\u043c\u0435\u043d\u0438 \u0421\u0430\u0445\u0430\u0440\u043e\u0432\u0430\">\u043f\u0440\u0435\u043c\u0438\u0438 \u0438\u043c\u0435\u043d\u0438 \u0410\u043d\u0434\u0440\u0435\u044f \u0421\u0430\u0445\u0430\u0440\u043e\u0432\u0430<\/a>.<\/li><\/ul><\/li><\/ul><h2>"}